import React from 'react';
import './App.css';

function Character(props){
  console.log(props, "<--- Here")
  return(
    <div>
      <h1>{props.char.name ? props.char.name : props.char.aliases[0]}</h1>
      <h4>{props.char.gender}</h4>
    </div>
  );
}

export default Character;
